    false,nt"url": null,nt"notes": "This annual narrative report for Swan Lake
    National Wildlife Refuge outlines Refuge accomplishments during the 1977 calendar
    year.  The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, fish, reptiles, disease, and rare and endangered species- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, collections and receipts, vegetation control, and prescribed burning.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, violations, and safety. N-R forms and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
